import React,{useState} from 'react';
import ShowIcon from '@material-ui/icons/KeyboardArrowDown';
import Fab from "@material-ui/core/Fab";



const  ShowTasksButton = (props)=> {
let[govnp,setgovno] = useState(false)
    {props.ShowTasksMode && setgovno(true)}
    return (
        <div>

            <Fab disabled={govnp} onClick={props.HandleOnClick}  size="small" color="primary" aria-label="edit" >
                <ShowIcon/>
            </Fab>
        </div>
    );
}
export default ShowTasksButton
